INSERT INTO `riskcontrol_rule` VALUES (4,'2024-02-27 16:07:51.715000','2024-06-04 17:20:05.448000','0','tfa','if !isNil(CurTfa.PhoneUpdatedAt) {\r\n  if Time.After(CurTfa.PhoneUpdatedAt, Time.NowAdd(Time.Hour * -1)){\r\n    return RiskCode.Forbidden\r\n  }\r\n}\r\nif !isNil(CurTfa.MailUpdatedAt){\r\n  if Time.After(CurTfa.MailUpdatedAt, Time.NowAdd(Time.Hour * -1)){\r\n    return RiskCode.Forbidden\r\n  }\r\n}\r\n/////\r\nif CurTfa.TxNeedVerify {\r\n  return RiskCode.Verify\r\n}\r\nreturn RiskCode.Pass',2,'tfa',1),(5,'2024-02-27 16:09:29.015000','2024-06-24 16:38:38.474000','0','ft_sum','	chainIds = NumberList.New(Context.ChainId)\r\n	/////\r\n	befor24h = Time.TimeStampBefore(Time.Day)\r\n\r\n	forRange i := SignTxs {\r\n		SignTx = SignTxs[i]\r\n		asset = AggDB.AssetAttr(Context.ChainId, SignTx)\r\n		cnt = AggDB.AssetFtSum(Cfg.AllChainIds, SignTx.From, asset, befor24h)\r\n\r\n		if asset.Symbol == \"RPG\" {\r\n			if asset.Value + asset.Value > 1 {\r\n				return RiskCode.Verify\r\n      }\r\n    }else if asset.Symbol == \"BNB\"{\r\n			if cnt + asset.Value > 0.02 {\r\n				return RiskCode.Verify\r\n			}\r\n    }else if asset.Symbol == \"MNT\"{\r\n			if cnt + asset.Value > 10 {\r\n				return RiskCode.Verify\r\n			}\r\n    }else if asset.Symbol == \"ETH\"{\r\n			if cnt + asset.Value > 0.003 {\r\n				return RiskCode.Verify\r\n			}\r\n    }else if asset.Symbol == \"USDT\"{\r\n			if cnt + asset.Value > 100 {\r\n				return RiskCode.Verify\r\n			}\r\n		}else if asset.Symbol == \"MUD\"{\r\n			if cnt + asset.Value > 1000 {\r\n				return RiskCode.Verify\r\n			}\r\n		}else if asset.Symbol == \"MIX\"{\r\n			if cnt + asset.Value > 5000  {\r\n				return RiskCode.Verify\r\n			}\r\n	  }\r\n	}\r\n	\r\n	return RiskCode.Pass',100,'AssetCnt',1),(6,'2024-02-27 16:26:57.958000','2024-06-20 18:38:57.006000','0','nft_cnt','chainIds = NumberList.New(Context.ChainId)\r\n///\r\nbefor24h = Time.TimeStampBefore(Time.Day)\r\n\r\nforRange i := SignTxs {\r\n  SignTx = SignTxs[i]\r\n\r\n  asset = AggDB.AssetAttr(Context.ChainId, SignTx)\r\n  cnt = AggDB.AssetNftCnt(chainIds, SignTx.From, asset, befor24h)\r\n\r\n  if asset.Symbol == \"Weapon\" {\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Key\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Miner\"{\r\n    if cnt > 10  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Equipment\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Fashion\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"WeaponFashion\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Man\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MTB\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Energy Core\"{\r\n    if cnt + asset.Value > 10 {\r\n      return RiskCode.Verify\r\n    }\r\n  }\r\n}\r\n\r\nreturn RiskCode.Pass',100,'AssetCnt',1),(8,'2024-03-01 16:33:06.048000','2024-08-07 18:21:29.889000','0','verify','return RiskCode.Pass\r\n',99,'verify',0),(9,'2024-06-20 16:31:28.060000','2024-08-07 18:21:26.744000','0','swapmarket','forRange i := SignTxs {\r\n  signTx = SignTxs[i]\r\n  /// 9527 swap and market\r\n  if signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\" || \r\n    signTx.Target == \"0x340518BDaE0A15f4e3B47fec2B4668674e0Fb910\" || \r\n    ////other chain   \r\n    signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\" || \r\n    signTx.Target == \"0xFc1a90688e5891CBA41864cF8A91abFAA82d5068\"  {\r\n    return RiskCode.Verify\r\n  }\r\n  return RiskCode.Pass\r\n}',5,'swapmarket',1);
